import './players.css';

const Players = () => {
    return(
        <div className='players'>
            <div className='player-1'>
                <a className='playerText'>Joueur 1</a>
            </div>
            <div className='player-2'>
                <a className='playerText'>Ordinateur</a>
            </div>
        </div>
    )
}


export default Players;
